import React, { useState, useEffect } from 'react';
import './style.css'

const SelectCar = () => {
  const [brand, setBrand] = useState([]);
  useEffect(() => {
    fetch(
      `api/models.json`,
      {
        headers : { 
          'Content-Type': 'application/json',
          'Accept': 'application/json'
         }
        }
    )
      .then(res =>{ res.json();console.log(res)})
      .then(response => {
        setBrand(response);
      })
      .catch(error => console.log(error));
  });

	return (
		<React.Fragment>
        <select>
      {brand.map(brand => (
        <option
          key={brand.model}
          value={brand.model}
        >
          {brand.model}
        </option>
      ))}
    </select>
		</React.Fragment>
	)
}

export default SelectCar;
